import React from 'react'

import PropTypes from 'prop-types'

const Thing = (props) => {
  return (
    <>
      <div className="container">
        <div className="container1">
          <img src={props.src} className="thqImage image" />
        </div>
        <div className="container2">
          <h3 className="thqHeading3 text">{props.name}</h3>
          <span className="date">{props.date}</span>
        </div>
      </div>
      <style jsx>
        {`
          .container {
            width: 100%;
            overflow: auto;
            position: relative;
            border-width: 0;
          }
          .container1 {
            width: 100%;
            height: 100px;
            display: flex;
            overflow: hidden;
          }
          .image {
            max-width: 100%;
            min-width: 100%;
            min-height: 100px;
            object-fit: cover;
          }
          .container2 {
            display: flex;
            padding: 10px;
            flex-wrap: nowrap;
            align-items: center;
            flex-direction: row;
            justify-content: space-between;
          }
          .text {
            overflow: hidden;
            flex-grow: 1;
            font-size: 14px;
            white-space: nowrap;
            padding-right: 20px;
            text-overflow: ellipsis;
          }
          .date {
            font-size: 12px;
            flex-shrink: 0;
          }
        `}
      </style>
    </>
  )
}

Thing.defaultProps = {
  src: 'https://play.teleporthq.io/static/svg/placeholders/no-image.svg',
  name: 'Name',
  date: 'Date',
}

Thing.propTypes = {
  src: PropTypes.string,
  name: PropTypes.string,
  date: PropTypes.string,
}

export default Thing
